// from https://github.com/PheoZen/Wurst-MC-1.8/blob/master/src/tk/wurst_client/features/commands/TacoCmd.java
let tacotoggle: boolean = false;
export function registertaco() {
    var url = "data:image/gif;base64,"

    fetch(url)
    .then(res => res.blob())
    .then(console.log)
}
export function displaytaco() {
    var taco = document.createElement("taco"); // Create a new "gui" element
    //@ts-ignore
    PluginAPI.addEventListener("update", ()=>{
        if (tacotoggle == true){
            if (document.pointerLockElement != null) {
                taco.innerHTML =`
                <taco id="dancingtaco">
                    <img src="data:image/gif;base64," style="
                    margin-top: 389px;
                    margin-left: 753px;
                ">
                </taco>
                `; // Set the HTML content of the "gui" element
                taco.id = "dancingtaco";
                taco.style.zIndex = '10';
                } else {
                    if (document.getElementById("dancingtaco")) { // If the "myGui" element exists
                        document.getElementById("dancingtaco").remove(); // Remove the "myGui" element from the document
                    }
                }
            } else {
                if (document.getElementById("dancingtaco")) { // If the "myGui" element exists
                    document.getElementById("dancingtaco").remove(); // Remove the "myGui" element from the document
                }
            }
    });
}
export function settacoToggle(theBoolean: boolean) {
    tacotoggle = theBoolean;
}
export function returntacoToggle(): boolean {
    return tacotoggle;
}